import Navbar from './Navbar';
import Home from './Home';
import {BrowserRouter as Router,Route,Routes} from 'react-router-dom'

function App() {
  return (
    <Router>
        <div className="App">
          <Navbar />
         <div className="content">
          <Routes>
            <Route exact path='/' Component={Home} />
          </Routes>
         </div>
        </div>
    </Router>
  );
}

export default App;
